    }

    return (
      <form>
        <input
          onChange={handleChange}
          name="username"
          type="text"
          placeholder="Username"
        />
        <input
          onChange={handleChange}
          name="password"
          type="password"
          placeholder="Password"
        />
        <button>Sign Up / Login</button>
      </form>
    );
}
